import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import * as B from "./style";

const AutoPlayCarousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,  // Troca a imagem a cada 2000 milissegundos (2 segundos)
    cssEase: "linear"
  };

  return (
    <Slider {...settings}>
      <div>
        <B.Foto src="./Banner_top_1_1920x." alt="Image 1" />
      </div>
      <div>
        <B.Foto src="../../photos/Banner_top_2_1920x.jpeg" alt="Image 2" />
      </div>
      <div>
        <B.Foto src="../../photos/Banner_top_3_1920x.jpeg" alt="Image 3" />
      </div>
    </Slider>
  );
};

export default AutoPlayCarousel;
